import React from 'react';
import logo from './logo.svg';
import './GameView.css';

function GameView() {
  return (
    <div className="GameView">
      <header className="GameView-header">
        <img src={logo} className="GameView-logo" alt="logo" />
        <h1>That's game, folks</h1>
      </header>
    </div>
  );
}

export default GameView;
